var ex_pak_sidebar = {
	init: function () {
		$('body').on('click', '.dop-product-sidebar .close', function () {
			ex_pak_sidebar.close();
		});
		$('body').on('click', '.dop-product-sidebar-overlay', function () {
			ex_pak_sidebar.close();
		});
	},
	show: function (siber_selecetor) {
		$(siber_selecetor).addClass('active');
		document.body.classList.add('sp_body_no_scroll');
		$('.dop-product-sidebar-overlay').show();
	},
	close: function () {
		$('.dop-product-sidebar.active').removeClass('active');
		document.body.classList.remove('sp_body_no_scroll');
		$('.dop-product-sidebar-overlay').hide();
	}
}

var ex_pak_product_sidebar = {
	init: function () {
		ex_pak_sidebar.init();
		$('body').on('click', '.dop-product-show-product-sidebar', function () {
			ex_pak_product_sidebar.show($(this).attr('data-product-id'));
		});
		$('body').on('change', '.dop-product-product-sidebar .product-selector .control select', function () {
			ex_pak_product_sidebar.selectProduct($(this).val());
		});
	},
	show: function (product_id) {
		if ($('.dop-product-product-sidebar').length) {
			ex_pak_sidebar.show('.dop-product-product-sidebar');
			if (product_id) {
				$('.dop-product-product-sidebar .product-selector .control select').val(product_id).trigger('change');
			}
			ex_pak_product_sidebar.setScripts();
		} else {
			if (typeof product_id != 'undefined') {
				data = {'product_id': product_id};
			} else {
				data = {};
			}
			if (typeof masked !== "undefined") {
				masked('body', true);
			}
			ex_pak.query('productSidebar', data, ex_pak_product_sidebar.showCallback);
		}
	},
	showCallback: function (result) {
		if (typeof masked !== "undefined") {
			masked('body', false);
		}
		$('.dop-product-product-sidebar').remove();
		if (result['html']) {
			$('body').append(result['html']);
			ex_pak_sidebar.show('.dop-product-product-sidebar');
			ex_pak.setCategories('.dop-product-product-sidebar .product-content.active');
		}
	},
	selectProduct: function (product_id) {
		// selector image
		$('.dop-product-sidebar .product-image.active').removeClass('active');
		$('.dop-product-sidebar .product-image-' + product_id).addClass('active');
		// content selector
		$('.dop-product-sidebar .product-content.active').removeClass('active');
		$('.dop-product-sidebar .product-content-' + product_id).addClass('active');
		ex_pak.setCategories('.dop-product-product-sidebar .product-content.active');
	},
	setSlider: function () {
		slider_selector = '.dop-product-product-sidebar .product-content.active .category-content.active';
		setting = {
			slidesPerView: 3,
			navigation: {
				prevEl: slider_selector + ' .swiper-button.prev',
				nextEl: slider_selector + ' .swiper-button.next',
			},
			breakpoints: {
				991: {slidesPerView: 3},
			},
		}
		ex_pak.setSlider(slider_selector, setting, false);
	}
}
    $(document).ready(function() 
    {
        init_hpmrr_event();
    });

    function card_prd(new_url, title)
    {
        $.ajax({
            type: "GET",
            url: new_url,
            //data: {'kjajax': 1 },
            success: function(response) {
                if(hpmrr_prd_config.change_url)
                {
                    window.history.pushState({}, title, new_url);
                }
                $('.tooltip').remove();
                success_ajax_product_cart(response);
            }
        });
    }

    function cat_prd(id, $hpm_block)
    {
        $.ajax({
            type: "GET",
            url: 'index.php?route=extension/module/hpmrr/product_json&pid=' + id,
            success: function(json) 
            {
                if (json['success']) 
                {
                    hpmrr_cat_config.replace_piece_cat(json['success'], $hpm_block);
                }
                $('.tooltip').remove();
            }
        });
    }

    function init_hpmrr_event() 
    {
        if ($("#product").length) 
        {
            //product card 
            window.onpopstate = function(event) {
               location.reload();
            }
        }

        if(typeof hpmrr_prd_config !=='undefined')
        {
            if(hpmrr_prd_config.refresh_price)
            {
                $(document).on('change', hpmrr_prd_config.pr_opts, function() {
                    $.ajax({
                      url: 'index.php?route=extension/module/hpmrr/get_price',
                      type: 'post',
                      data: $(hpmrr_prd_config.pr_opts),
                      success: function(json) {
                        hpmrr_prd_config.refresh_price_func(json);
                      }
                    });
                });
            }
                
            if(!hpmrr_prd_config.redirect)
            {
                $(document).on("click", ".hpm-block-prd a", function(e) {
                    e.preventDefault();
                 
                    let $target = $(this).find(".hpmcircle").length ? $(this).find(".hpmcircle") : $(this);
                    $target.addClass("text-center").height($(this).height()).css('line-height', $(this).height()+"px").width($(this).width()).html('<i class="fa fa-spinner fa-spin"></i>');
                    $(this).removeClass("disabled").addClass("active").siblings().removeClass("active");
                    card_prd($(this).attr("href"), $(this).attr("title"));
                    return false;
                });

                $(document).on("change", ".hpm-block-prd select", function(e) {
                    card_prd(this.value, $(this).find("option:selected").data('title'));
                });

                $('.dropdown-select').on( 'click', '.dropdown-menu li a', function(e) { 
                    card_prd($(this).attr("href"), $(this).attr('title'));
                    return false;
                });
            }
            else
            {
                $(document).on("change", ".hpm-block-prd select", function(e) {
                    window.location = this.value;
                });
            }
        }
        
        //category
        if(typeof hpmrr_cat_config !=='undefined')
        {
            if(!hpmrr_cat_config.redirect)
            {
                $(document).on("click", ".hpm-block-cat a", function(e) {
                    e.preventDefault();
                    
                    let $target = $(this).find(".hpmcircle").length ? $(this).find(".hpmcircle") : $(this);
                    $target.addClass("text-center").height($(this).height()).css('line-height', $(this).height()+"px").width($(this).width()).html('<i class="fa fa-spinner fa-spin"></i>');
                        $(this).removeClass("disabled").addClass("active").siblings().removeClass("active");
                    cat_prd($(this).data("pid"), $(this).parents(".hpm-block-cat"));
                    return false;
                })

                $(document).on("change", ".hpm-block-cat select", function(e) {
                    cat_prd(this.value, $(this).parents(".hpm-block-cat"));
                });

                $('.dropdown-select').on( 'click', '.dropdown-menu li a', function(e) { 
                    cat_prd($(this).data("pid"), $(this).parents(".hpm-block-cat"));
                    return false;
                });
            }
            else
            {
                $(document).on("change", ".hpm-block-cat select", function(e) {
                    window.location = $(this).find("option:selected").attr("data-link");
                });
            }
        }
    }

    function success_ajax_product_cart(data)
    {
        var $wrap_html =  $('<div>').html(data);

        hpmrr_prd_config.before_ajax($wrap_html);
        $.each(hpmrr_prd_config.ajax_replace, function(index, val) 
        {
            if ($wrap_html.find(val).length) 
            {
                $(val).html($wrap_html.find(val).html());
            } else {
                $(val).html('');
            }
        });
        $(".hpm-block-prd").remove();

        $("body").append($wrap_html.find(".hpm-block-prd")[0].outerHTML);
        hpmrr_setpos();
        hpmrr_prd_config.after_ajax($wrap_html);
    }
